import Cards from "./Cards";
import Data from "./Data"

function CardsList(){
    return(
        <div className="cards_list">

            {Data.map(function(data){
            return <Cards 
                        imgsrc = {data.imgsrc}
                        heading = {data.heading}
                        name = {data.name}
                        link = {data.link}
                    />
            })}


        </div>
    )
}
export default CardsList
